import React from "react";
import "./styles.scss";

const Home = () => {
    return (
        <>
            <div className="contentHome">
                <nav className="wrap_nav_video">
                    <div className="menu">
                        <ul>
                            <li><NavLink to="/">Home</NavLink></li>
                            <li><NavLink to="/news">News</NavLink></li>
                            <li><NavLink to="/contacts">Comtacts</NavLink></li>
                        </ul>
                    </div>
                </nav>
                <h1> This is Home</h1>
            </div>
        </>
    )
}
export default Home;
